  // Timing (slow)
  const T_RING = 3200;   // ring draw duration
  const T_HOLD = 400;    // short pause
  const T_REVEAL = 2800; // logo reveal duration
  const T_FADE = 600;    // final fade-in polish
  const T_TOTAL = T_RING + T_HOLD + T_REVEAL + T_FADE;

  // helpers
  const easeInOut = t => t<0.5 ? 2*t*t : 1- Math.pow(-2*t+2,2)/2;
  const clamp01 = t => Math.max(0, Math.min(1, t));

  function draw(tMs) {
    const w = window.innerWidth, h = window.innerHeight;
    ctx.clearRect(0,0,w,h);
    // black bg
    ctx.fillStyle = "#000";
    ctx.fillRect(0,0,w,h);

    if (!img.complete) return;

    // Fit logo to screen
    const pad = Math.min(w,h) * 0.12;
    const target = Math.min(w,h) - pad*2;
    const scale = target / Math.max(img.width, img.height);
    const iw = img.width * scale;
    const ih = img.height * scale;
    const x0 = (w - iw)/2;
    const y0 = (h - ih)/2;

    // Ring arc geometry (approx to match logo)
    // We draw two strokes: one starts near top-right (above E) and one near bottom-left (below A).
    const cx = x0 + iw/2;
    const cy = y0 + ih/2;
    const rOuter = Math.min(iw, ih) * 0.40;
    const rInner = rOuter * 0.86;

    // Stage 1: ring stroke drawing
    const tr = clamp01(tMs / T_RING);
    const pr = easeInOut(tr);

    ctx.lineCap = "round";
    ctx.lineJoin = "round";
    ctx.strokeStyle = "rgba(255,255,255,0.95)";
    ctx.lineWidth = Math.max(6, Math.min(w,h)*0.012);

    // top stroke: from ~20 to ~200 (sweeping left)
    const a1s = (20 * Math.PI/180);
    const a1e = (200 * Math.PI/180);
    const a1 = a1s + (a1e - a1s) * pr;

    ctx.beginPath();
    ctx.arc(cx, cy, rOuter, a1s, a1, false);
    ctx.stroke();

    // bottom stroke: from ~200 to ~380 (sweeping right)
    const a2s = (200 * Math.PI/180);
    const a2e = (380 * Math.PI/180);
    const a2 = a2s + (a2e - a2s) * pr;

    ctx.beginPath();
    ctx.arc(cx, cy, rOuter, a2s, a2, false);
    ctx.stroke();

    // inner subtle stroke (to mimic double ring look)
    ctx.strokeStyle = "rgba(255,255,255,0.55)";
    ctx.lineWidth = Math.max(3, Math.min(w,h)*0.006);

    ctx.beginPath();
    ctx.arc(cx, cy, rInner, a1s, a1, false);
    ctx.stroke();
    ctx.beginPath();
    ctx.arc(cx, cy, rInner, a2s, a2, false);
    ctx.stroke();

    // Stage 2: reveal full logo image after ring
    const t2 = tMs - (T_RING + T_HOLD);
    const revealT = clamp01(t2 / T_REVEAL);
    const pReveal = easeInOut(revealT);

    if (t2 > 0) {
      // We reveal starting from bottom-left (near A bottom), growing horizontally and upward.
      // Mask is a rounded rect expanding.
      const margin = Math.max(4, ctx.lineWidth*0.8);
      // Start reveal from a point that touches the INNER edge of the first (outer) ring,
      // but stays just inside the inner ring so it doesn't spill outside.
      const startAngle = 225 * Math.PI/180; // lower-left quadrant
      const px = cx + Math.cos(startAngle) * (rInner - margin);
      const py = cy + Math.sin(startAngle) * (rInner - margin);

      // Use that point as the bottom-left anchor of the reveal mask
      const mx0 = px;
      const my0 = py; // start point (inside ring)
      const mw = iw * (0.15 + 0.85*pReveal);
      const mh = ih * (0.15 + 0.85*pReveal);

      ctx.save();
      // clip path
      const r = Math.min(iw,ih) * 0.03;

      // Clamp the mask so it always stays inside the logo bounds
      let x = mx0;
      let yb = my0; // bottom of mask
      x = Math.min(Math.max(x, x0 + iw*0.02), (x0 + iw*0.98) - mw);
      yb = Math.min(Math.max(yb, (y0 + ih*0.12) + mh), (y0 + ih*0.98));
      const y = yb - mh;

      ctx.beginPath();
      ctx.moveTo(x+r, y);
      ctx.arcTo(x+mw, y, x+mw, y+mh, r);
      ctx.arcTo(x+mw, y+mh, x, y+mh, r);
      ctx.arcTo(x, y+mh, x, y, r);
      ctx.arcTo(x, y, x+mw, y, r);
      ctx.closePath();
      ctx.clip();

      // draw image
      ctx.globalAlpha = 1.0;
      ctx.drawImage(img, x0, y0, iw, ih);
      ctx.restore();

      // final gentle fade to full opacity over everything
      const t3 = tMs - (T_RING + T_HOLD + T_REVEAL);
      const fade = clamp01(t3 / T_FADE);
      if (t3 > 0) {
        ctx.save();
        ctx.globalAlpha = fade;
        ctx.drawImage(img, x0, y0, iw, ih);
        ctx.restore();
      }
    }
  }

  let start = null;
  function loop(ts) {
    if (!start) start = ts;
    const tMs = (ts - start) % T_TOTAL;
    draw(tMs);
    requestAnimationFrame(loop);
  }
  img.onload = () => requestAnimationFrame(loop);
})();
